import React, { useState } from 'react';

const FAQSection = ({ title = "Frequently Asked Questions", subtitle = "Find answers to common questions about our services" }) => {
  const [openIndex, setOpenIndex] = useState(0);

  const faqs = [
    {
      category: "General",
      questions: [
        {
          question: "What services does Skygate Group provide?",
          answer: "Skygate Group provides comprehensive logistics and travel solutions. Our logistics division specializes in freight forwarding from the United States and China, warehousing, supply chain management, and last-mile delivery. Our travel division offers medical travel assistance, educational guidance for international scholarships, corporate travel management, and leisure travel planning."
        },
        {
          question: "How long has Skygate Group been in business?",
          answer: "Skygate Group was founded in 2018 with a vision to connect people, opportunities, and businesses across borders. We have over 7 years of experience in delivering professional solutions that help clients worldwide."
        },
        {
          question: "What makes Skygate Group different from competitors?",
          answer: "We combine care, innovation, and professionalism to deliver services that move people and businesses forward. Our integrated approach ensures smooth experiences and efficient operations at every step, with specialized expertise in medical travel and educational guidance."
        }
      ]
    },
    {
      category: "Logistics",
      questions: [
        {
          question: "What countries do you ship to and from?",
          answer: "We specialize in freight forwarding from the United States and China to over 50 countries worldwide. Our global network ensures reliable delivery to major markets across all continents."
        },
        {
          question: "How do you handle customs and documentation?",
          answer: "Our experienced team handles all customs clearance and documentation requirements. We ensure compliance with international regulations and provide real-time tracking throughout the entire shipping process."
        },
        {
          question: "What types of cargo do you handle?",
          answer: "We handle various types of cargo including manufactured goods, electronics, textiles, automotive parts, healthcare supplies, and more. Our specialized solutions cater to industries like manufacturing, retail, healthcare, and technology."
        }
      ]
    },
    {
      category: "Travel",
      questions: [
        {
          question: "Do you provide medical travel assistance?",
          answer: "Yes, we specialize in coordinating medical travel to world-class hospitals abroad. We help patients access quality healthcare facilities and provide comprehensive support throughout their medical journey."
        },
        {
          question: "Can you help with international scholarship applications?",
          answer: "Absolutely! We guide students toward international scholarship opportunities and provide assistance with the application process, helping them secure educational opportunities abroad."
        },
        {
          question: "What travel support do you offer?",
          answer: "We provide 24/7 travel support, booking assistance, travel insurance guidance, and comprehensive travel planning for both corporate and leisure travel needs."
        }
      ]
    }
  ];

  return (
    <section className="section-compact bg-gray-50 relative overflow-hidden">
      {/* Background Elements */}
      <div className="absolute inset-0 bg-gradient-to-br from-primary-50/20 via-transparent to-travel-50/10"></div>
      <div className="absolute top-20 right-20 w-96 h-96 bg-primary-100/10 rounded-full blur-3xl animate-float-slow"></div>
      <div className="absolute bottom-20 left-20 w-80 h-80 bg-travel-100/10 rounded-full blur-3xl animate-float-slow" style={{animationDelay: '2s'}}></div>

      <div className="container-premium relative z-10">
        {/* Header */}
        <div className="text-center mb-16">
          <h2 className="text-section-title text-gray-900 mb-6">
            {title}
          </h2>
          <p className="text-body-large text-gray-600 max-w-3xl mx-auto">
            {subtitle}
          </p>
        </div>

        {/* Category Tabs */}
        <div className="flex flex-wrap justify-center mb-12 gap-4">
          {faqs.map((category, index) => (
            <button
              key={index}
              onClick={() => setOpenIndex(index)}
              className={`px-6 py-3 rounded-xl font-semibold transition-all duration-300 ${
                openIndex === index
                  ? 'bg-primary-600 text-white shadow-lg'
                  : 'bg-white text-gray-700 hover:bg-primary-50 border border-gray-200'
              }`}
            >
              {category.category}
            </button>
          ))}
        </div>

        {/* FAQ Items */}
        <div className="max-w-4xl mx-auto">
          {faqs[openIndex].questions.map((faq, index) => (
            <div key={index} className="mb-4">
              <FAQItem question={faq.question} answer={faq.answer} />
            </div>
          ))}
        </div>

        {/* Contact CTA */}
        <div className="text-center mt-16 pt-12 border-t border-gray-200">
          <h3 className="text-2xl font-bold text-gray-900 mb-4">
            Still have questions?
          </h3>
          <p className="text-gray-600 mb-8 max-w-2xl mx-auto">
            Our expert team is here to help. Contact us for personalized assistance with your specific needs.
          </p>
          <div className="flex flex-col sm:flex-row gap-4 justify-center">
            <button 
              onClick={() => window.location.href = '/contact#get-in-touch'}
              className="px-8 py-4 bg-gradient-to-r from-primary-500 to-primary-600 text-white font-bold rounded-xl hover:from-primary-600 hover:to-primary-700 transition-all duration-300 shadow-lg hover:shadow-xl transform hover:-translate-y-1"
            >
              Contact Us Today
            </button>
            <button 
              onClick={() => window.location.href = '/contact?category=general'}
              className="px-8 py-4 border-2 border-primary-500 text-primary-500 font-bold rounded-xl hover:bg-primary-500 hover:text-white transition-all duration-300"
            >
              Ask a Question
            </button>
          </div>
        </div>
      </div>
    </section>
  );
};

const FAQItem = ({ question, answer }) => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div className="bg-white rounded-2xl shadow-sm hover:shadow-md transition-all duration-300 overflow-hidden">
      <button
        onClick={() => setIsOpen(!isOpen)}
        className="w-full px-6 py-4 text-left flex items-center justify-between hover:bg-gray-50 transition-colors duration-200"
      >
        <span className="text-lg font-semibold text-gray-900 pr-4">
          {question}
        </span>
        <svg 
          className={`w-5 h-5 text-gray-500 transition-transform duration-200 ${isOpen ? 'rotate-180' : ''}`}
          fill="none" 
          stroke="currentColor" 
          viewBox="0 0 24 24"
        >
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
        </svg>
      </button>

      {isOpen && (
        <div className="px-6 pb-4">
          <p className="text-gray-700 leading-relaxed">
            {answer}
          </p>
        </div>
      )}
    </div>
  );
};

export default FAQSection;
